import React from 'react';

class Form extends React.Component {
  render() {
    return(
      <div>
        <table>
          <thead>
            <tr>
              <th>Nội dung</th>
              <th>Giá trị</th>
            </tr>
          </thead>
          
        </table>
      </div>
    )
  }
}

export default Form
